CREATE FUNCTION public.calculate_station_utilization_metrics(p_station_prefix text, p_time_from timestamp with time zone, p_time_to timestamp with time zone) RETURNS TABLE(station_name text, total_station_time_seconds numeric, active_time_seconds numeric, utilization_percentage numeric)
