-- Name: insert_xbot_state(text, integer, text, timestamp without time zone, uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.insert_xbot_state(topic text, station_id integer, state text, timestamp_value timestamp without time zone, uuid uuid) RETURNS void
    LANGUAGE plpgsql
    AS $_$
DECLARE
    xbot_id TEXT;
    table_name TEXT;
BEGIN
    -- Extract Xbot ID from topic
    xbot_id := substring(topic FROM 'NN/Nybrovej/InnoLab/Planar/([^/]+)/DATA/State');
    
    -- Convert to lowercase and remove any non-alphanumeric characters for safety
    table_name := lower(regexp_replace(xbot_id, '[^a-zA-Z0-9]', '', 'g')) || '_state';
    
    -- Execute dynamic SQL to insert into the appropriate table
    EXECUTE format('
            station_id,
            state,
            timestamp_utc,
            uuid
        ) VALUES ($1, $2, $3, $4)',
        table_name)
    USING station_id, state, timestamp_value, uuid;
END;
$_$;


